    /**
     *
     * @param ObjectManager $manager
     * @param type $n
     */
    private function createRoute(ObjectManager $manager, $n)
    {
        $rutaN = substr($n[5], 1);
        $ruta = 'R'.$n[3].$n[4].$rutaN;
        $user = $manager->getRepository('AppBundle:Usuario')->findOneBy(['username' => 'roberto.zuniga.araya@gmail.com']);
        $route = new Route($user);
        $route->setName($ruta);
        if(is_numeric($rutaN)) {
            $route->setNumber($rutaN);
        }else{
            $route->setNumber(1);
        }
        $route->setDay($n[3]);
        $route->setRoute($n[5]);
        $route->setRouteAlt($n[6]);
        $route->setAddress($n[0]);
        $route->setDispatch($this->getDispatch($manager,$n[1]));
        $route->setRegion($this->getRegion($manager, $n[4]));

        $manager->persist($route);
    }

    /**
     * @param ObjectManager $manager
     * @param $name
     * @return Dispatch
     */
    public function getDispatch(ObjectManager $manager, $name)
    {
        return $manager->getRepository('AppBundle:Dispatch')->findOneBy(['nomDch' => $name]);
    }

    /**
     * @param ObjectManager $manager
     * @param $name
     * @return Region
     */
    public function getRegion(ObjectManager $manager, $name)
    {
        return $manager->getRepository('AppBundle:Region')->findOneBy(['code' => $name]);
    }
